'use client';
import React, { useState } from 'react';
import { Button } from '@/components/ui/button';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import { format } from 'date-fns';
import { formatInTimeZone } from 'date-fns-tz';
import { id } from 'date-fns/locale';
import { ReportItem } from './CashflowPage';

pdfMake.vfs = pdfFonts.vfs;

type ExportPdfButtonProps = {
  data: ReportItem[];
};

async function fetchImageAsBase64(url: string) {
  try {
    const response = await fetch(url);
    const buffer = await response.arrayBuffer();
    const base64 = Buffer.from(buffer).toString('base64');
    const mimeType = url.endsWith('.png') ? 'image/png' : 'image/jpeg';
    return `data:${mimeType};base64,${base64}`;
  } catch (err) {
    console.error('Gagal mengambil gambar', err);
    return null;
  }
}

const ExportPdfButton = ({ data }: ExportPdfButtonProps) => {
  const [loading, setLoading] = useState(false);

  const generatePdf = async () => {
    setLoading(true);
    const firstUtc = new Date(data[0].date);
    const monthYear = formatInTimeZone(firstUtc, 'Asia/Jakarta', 'LLLL yyyy', {
      locale: id
    });
    const fileName = `laporan-bbm-Akasia-${monthYear.toLowerCase().replace(' ', '-')}.pdf`;

    const processedData = await Promise.all(
      data.map(async (item) => {
        const imageBase64 = item.receiptFile
          ? await fetchImageAsBase64(item.receiptFile)
          : null;
        return { ...item, imageBase64 };
      })
    );

    const totalMasuk = processedData.reduce(
      (sum, d) => sum + (d.credit || 0),
      0
    );
    const totalKeluar = processedData.reduce(
      (sum, d) => sum + (d.debit || 0),
      0
    );

    const tableBody = [
      [
        { text: 'Tanggal', bold: true },
        { text: 'Deskripsi & Catatan', bold: true },
        { text: 'Masuk', bold: true },
        { text: 'Keluar', bold: true },
        { text: 'Saldo', bold: true }
      ],
      ...processedData.map((d) => [
        format(new Date(d.date), 'dd-MM-yyyy'),
        {
          stack: [
            d.description,
            d.notes
              ? {
                  text: `üìù ${d.notes}`,
                  fontSize: 9,
                  color: 'gray',
                  margin: [0, 2, 0, 0]
                }
              : ''
          ]
        },
        d.credit?.toLocaleString() || '-',
        d.debit?.toLocaleString() || '-',
        d.runningBalance.toLocaleString()
      ]),
      [
        { text: 'Total', bold: true, colSpan: 2, alignment: 'right' },
        {},
        { text: totalMasuk.toLocaleString(), bold: true },
        { text: totalKeluar.toLocaleString(), bold: true },
        {}
      ]
    ];

    // eslint-disable-next-line @typescript-eslint/no-explicit-any
    const pages: any[] = [
      {
        text:
          'Laporan Keuangan Pemasukan dan Pengeluaran BBM AKASIA ' + monthYear,
        style: 'header',
        alignment: 'center',
        margin: [0, 0, 0, 10]
      },
      {
        table: {
          headerRows: 1,
          widths: ['auto', '*', 'auto', 'auto', 'auto'],
          body: tableBody
        },
        layout: 'lightHorizontalLines',
        margin: [0, 10, 0, 10]
      }
    ];

    const receipts = processedData.filter((d) => d.imageBase64);
    if (receipts.length) {
      pages.push({
        text: 'Lampiran Nota',
        style: 'header',
        alignment: 'center',
        pageBreak: 'before',
        margin: [0, 0, 0, 20]
      });

      // Group receipts into pairs
      for (let i = 0; i < receipts.length; i += 2) {
        const pair = receipts.slice(i, i + 2); // Take up to 2 receipts
        const pairContent = pair.map((receipt) => ({
          stack: [
            {
              text: format(new Date(receipt.date), 'dd-MM-yyyy'),
              alignment: 'center',
              bold: true,
              margin: [0, 10, 0, 5]
            },
            {
              text: receipt.description,
              alignment: 'center',
              margin: [0, 0, 0, 5]
            },
            receipt.notes
              ? {
                  text: `üìù ${receipt.notes}`,
                  alignment: 'center',
                  fontSize: 9,
                  color: 'gray',
                  margin: [0, 0, 0, 10]
                }
              : {},
            receipt.imageBase64
              ? {
                  image: receipt.imageBase64,
                  fit: [500, 250], // Reduced height to ensure two images fit
                  alignment: 'center'
                }
              : {
                  text: 'Gambar tidak tersedia',
                  alignment: 'center',
                  color: 'red'
                }
          ],
          margin: [0, 0, 0, 10] // Reduced margin for tighter spacing
        }));

        pages.push({
          stack: pairContent,
          unbreakable: true, // Prevent splitting pair across pages
          pageBreak: i + 2 < receipts.length ? 'after' : undefined // Only add pageBreak if more pairs follow
        });
      }
    }

    const docDefinition = {
      content: pages,
      styles: {
        header: { fontSize: 18, bold: true }
      },
      pageMargins: [40, 60, 40, 60],
      background: function (currentPage, pageSize) {
        return {
          image:
            'data:image/png;base64,', // base64 dari gambar
          width: pageSize.width,
          opacity: 0.2
        };
      }
    };
    // eslint-disable-next-line @typescript-eslint/ban-ts-comment
    // @ts-ignore
    pdfMake.createPdf(docDefinition).download(fileName);
    setLoading(false);
  };

  return (
    <Button onClick={generatePdf} disabled={loading}>
      {loading ? 'Membuat PDF...' : 'Unduh PDF'}
    </Button>
  );
};

export default ExportPdfButton;
